<?php

/* @autogenerated */
declare(strict_types=1);

namespace Civi\Lughauth\Shared\Infrastructure\Management\Log;

const GZGETS_OVERRIDE_FLAG = '__test_force_gzgets_false';

function gzopen(string $file, string $mode)
{
    return \gzopen($file, $mode);
}

function gzeof($h): bool
{
    if (!empty($GLOBALS[GZGETS_OVERRIDE_FLAG])) {
        return false;
    }
    return \gzeof($h);
}

function gzgets($h)
{
    if (!empty($GLOBALS[GZGETS_OVERRIDE_FLAG])) {
        return false;
    }
    return \gzgets($h);
}

function gzclose($h): void
{
    \gzclose($h);
}
